  false,\n\t\"url\": null,\n\t\"notes\": \"The National Public Education Financial
  Survey, 2013-14 (NPEFS 2013-14), is a study that is part of the Common Core of Data's
  National Public Education Financial Survey program; program data is available since
  1987 at <http://nces.ed.gov/ccd/stfis.asp>. CCD-NPEFS 2013-14 [http://nces.ed.gov/ccd/stfis.asp]
  is a cross-sectional survey that gathers data on the financing of education. NPEFS
  data are used in calculating statesufffd Title I grants. The study was conducted
  using responding agencies' existing administrative records. The universe of state
  agencies was sampled. The study's response rate has not been calculated as of May
  2013. Key statistics produced from CCD-NPEFS 2013-14 will collect data on attendance,
  revenue, and expenditure data from which NCES determines a Stateufffds 'average
  per-pupil expenditure' (SPPE) for elementary and secondary education.\",\n\t\"license_title\":
